import './Reviews.css';

import reviews from './revs.json'

const Reviews = () => {

  let data = reviews.data


  return (
    <div>
      {
      data.map((review => (
        <div key={review.id} className='reviews'>
          <p>{review.author_title}</p>
        </div>
      )))
      }
    </div>
  );
};

export default Reviews;
